import React from "react";

// import "./Title3.css";
import Particles from "react-particles-js";

const title = props => {
  return (
    <Particles
      params={{
        polygon: {
          enable: true,
          type: "inside",
          move: {
            radius: 10
          },
          url: "path/to/svg.svg"
        }
      }}
    />
  );
};

export default title;
